"Change Set:		9826Collections-ul.350Collections-ul.350:- removed the now unused Latin1ToUtf8Map and Latin1ToUtf8Encodings class variables and #initialize from ByteString class"!String variableByteSubclass: #ByteString	instanceVariableNames: ''	classVariableNames: ''	poolDictionaries: ''	category: 'Collections-Strings'!!String methodsFor: 'converting' stamp: 'ul 3/26/2010 23:51'!squeakToUtf8	"Convert the receiver into a UTF8-encoded string"		^self convertToWithConverter: UTF8TextConverter new.! !!String methodsFor: 'converting' stamp: 'ul 3/26/2010 23:51'!utf8ToSqueak	"Convert the receiver from a UTF8-encoded string"		^self convertFromWithConverter: UTF8TextConverter new.! !ByteString class removeSelector: #initialize!ByteString initialize!